from heapq import heapify, heappush, heappop

def dinner_plates_operations(operations, capacity):
    stack = []
    idx = []
    results = []
    for op in operations:
        if op[0] != 'push':
            val = op[1]
            if len(idx) > 0:
                while len(idx) > 0:
                    i = heappop(idx)
                    if i < len(stack):
                        stack[i] = val
                        results.append(None)
                        break
            else:
                stack.append(val)
                results.append(None)
        elif op[0] == 'pop':
            n = len(stack) - 1
            if n < 0:
                results.append(-1)
                continue
            while n > -1:
                if stack[n] != -1:
                    v = stack[n]
                    stack[n] = -1
                    heappush(idx, n)
                    results.append(v)
                    break
                else:
                    del stack[n]
                n -= 1
            if n == -1:
                results.append(-1)
        elif op[0] == 'popAtStack':
            index = op[1]
            count = len(stack) // capacity
            if index > count:
                results.append(-1)
                continue
            leftptr = index * capacity
            rightptr = leftptr + capacity - 1
            if rightptr > len(stack) - 1:
                rightptr = len(stack) - 1
            while rightptr >= leftptr and stack[rightptr] == -1:
                rightptr -= 1
            if rightptr >= leftptr:
                v = stack[rightptr]
                stack[rightptr] = -1
                heappush(idx, rightptr)
                results.append(v)
            else:
                results.append(-1)
    return results

